  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Caroline Elizabeth and LUDBROOK, Samuel Blomfield
  JLUDBROOK, Henry Samuel (Harry) and KINSELLA, Hana
  JLUDBROOK , Cecil Edward Blomfield and GIESEN, Margaret Henrietta
  JLUDBROOK, Samuel Blomfield and ELLETT, Christine Robyn.
  LUDBROOK, Samuel Blomfield and ELLETT, Christine Robyn (cont...)
  Tupe". Samuel and Christine are also the proprietors of a Lodge and art gallery in Ludbrook House, the
  house built by Samuel's grandparents. They have established a new venture called Fine Food for Fine
  Occasions, a mail-order business supplying leading department stores and delicatessens nationwide.
  Samuel is a life member of the Bay of Islands Rugby Referees Association and a life member of the
  Northland Players Theatre Company. Other interests include the Waimate Show Committee, Kaikohe Golf
  Club, cricket and deep sea fishing.
  Christine is a physiotherapist and a former member of the Community Health Advisory Committee to the
  Northland Area Health Board. She is also Past President of the Kaikohe Golf Club (Ladies).
  01> LUDBROOK, Katherine Ann m on 20.04.1991 to BROWN, Marcus Andrew
  b 04.06.1964
  b 17.01.1962
  Katherine b. at Kawakawa and m. at Waimate North. She is known by her maiden name. Marcus, slo
  George Brown and Rachael Harper Marsh, b. at Ruatoria. Address: PO Box 12, Ohaeawai, Bay of
  Islands.
  Katherine was educated at Ohaeawai, St Cuthbert's College, Otago Polytechnic and the Auckland
  Institute of Technology. She is a physiotherapist with a Post-Graduate Diploma in manipulative
  therapy. She purchased the Epsom Physiotherapy Clinic on her own account in 1990. Her particular
  interests are sports and manipulative physiotherapy.
  Marcus was educated at Horowhenua College, Levin (head boy). He joined the Air Force as an
  avionics technician. He has played rugby for Horowhenua, Manawatu, Auckland, New Zealand Combined
  Services and New Zealand Universities. As a yachtsman, Marcus was a member of the New Zealand
  Americas Cup Challenge team in Perth and San Diego and has since completed a Bachelor of Commerce
  degree at Auckland University.
  02> LUDBROOK, Roger Samuel Ellett
  b 31.05.1966
  Roger b. at Auckland. He was educated at Ohaeawai, King's College and Lincoln College where he
  completed a Bachelor of Agricultural Commerce degree. In 1994 he graduated Master of Technology
  from Massey University and he is presently manager of "Tupe Tupe" farm at Ohaewai. Roger's
  interests include fishing, rugby and running.
  03> LUDBROOK, Matthew David Ellett
  b 11.09.1969
  Matthew b. at Whangarei and educated at Ohaeawai and King's College. He represented his school at
  rowing and rugby. Later he represented the Waikato Rugby Union in the Colts and Development Squads
  before returning to the Bay of Islands where he played for Ohaeawai and North Auckland. He
  graduated Bachelor of Business Studies from Massey University Albany Campus in 1995 then undertook
  further studies at Boston College Graduate Management School, USA, in 1996, gaining a Certificate
  of Management.
  06>'LUDBROOK, Geoffrey Valentine m on 02.11.1927 to WHIBLEY, Lucy
  b 17.08.1904 d 02.07.1989
  b 24.05.1900 d 15.09.1983
  Geoffrey b. at "Tupe Tupe", Ohaeawai, d. at Auckland and bd. at Holy Trinity Church, Pakaraka. Lucy b. in
  the Ellis Islands and bd, at Holy Trinity Church, Pakaraka.
  Geoffrey was educated at Huntley School, Wanganui Collegiate School and Lincoln College. He then farmed at
  "Pouerua", Bay of Islands from 1927 until he retired to Paihia in 1970. They later moved to Auckland. He
  served on the Vestry of the Holy Trinity Church, Pakaraka for 34 years. Lucy was educated at Remuera
  Ladies' College and trained as a registered nurse at the Auckland Hospital. She had a florist shop in
  Kaikohe for a time and later she was active in Red Cross, Women's Division of Federated Farmers and church
  work.
